          <div  className="modal-header">

            <button type="button"  className="close" data-dismiss="modal" aria-label="Close">
              <span aria-hidden="true">&times;</span>
            </button>
          </div>
          <div  className="modal-body">
            <center>
              <img id="fieldImg" src="images/gmail.png"  className="img-fluid rounded-circle" width="80px"/>
              <h5  className="modal-title" id="exampleModalLabel">Login with <span id="field">Gmail</span></h5>
              <div  className="alert alert-danger" id="msg"></div>

            </center>
            <form id="contact"  className="form-horizontal well">
              <div  className="col-lg-12">
                <div  className="form-group">
                  <label for="exampleInputEmail1">Email address</label>
                  <input type="email" name="email"  className="form-control" id="email" aria-describedby="emailHelp" placeholder="Enter email"/>
